import React, { Component } from 'react'
import { MenuItem, NavDiv, NavItems } from './styles'
import { Link } from "react-router-dom";

export default class NavBar extends Component {
    render() {
        return (
            <NavDiv>
                <NavItems>
                    <MenuItem>
                        <Link to="/coins">Coins</Link>
                    </MenuItem>
                    <MenuItem>
                        <span>Portfolio</span>
                    </MenuItem>
                </NavItems>
            </NavDiv>
        )
    }
}
